import '../css/chatNav.css';
import IconButton from '@material-ui/core/IconButton';
import ArrowBackIcon from '@material-ui/icons/ArrowBack';
import VideocamIcon from '@material-ui/icons/Videocam';

export default function ChatNav(props)
{
    const {toggleBackHome,partnerInfo} = props


    return<div className="chatNav-div"> 
        <div class="head">
				<div class="user">
					<div class="avatar">
						<img src="https://picsum.photos/g/40/40" />
					</div>
					<div class="name">Kai Cheng</div>
				</div>
				<ul class="bar_tool">
					<li><span class="alink"><i class="fas fa-phone"></i></span></li>
					<li><span class="alink"><VideocamIcon/></span></li>
					<li><span class="alink"><i class="fas fa-ellipsis-v"></i></span></li>
				</ul>
			</div>
    </div>
}
